import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
        <ul className="nav-links">
        <li>
            <Link to="/pull">pull</Link>
            </li>
            <li>
            <Link to="/pull">pull</Link>
            </li>
            <li>
            <Link to="/pull">pull</Link>
            </li>
        </ul>
    </nav>
  );
};

export default Navbar;
